const fetchDniData = async (dni) => {
    try {
      const response = await fetch(`https://dniruc.apisperu.com/api/v1/dni/${dni}?token=eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9.eyJlbWFpbCI6ImtldmluZmdlMjQxMEBnbWFpbC5jb20ifQ.Ha6IN3AcX5zAC1pBssILUz1U8lg03rodOkh2rpxjKag`);
      const data = await response.json();
  
      if (!response.ok) {
        console.error('Error al buscar DNI:', data.message);
        return null;
      }
  
      return data;
    } catch (error) {
      console.error('Error al buscar DNI:', error.message);
      return null;
    }
  };
  
  export default fetchDniData;
